var topic = "<!DOCTYPE html>\r\n\n<!-- saved from url=(0024)http://docs.autodesk.com -->\r\n<html>\n   <head>\n      <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n      <meta name=\"product\" content=\"ACD\">\n      <meta name=\"release\" content=\"2019\">\n      <meta name=\"book\" content=\"Installation\">\n      <meta name=\"created\" content=\"2018-01-15\">\n      <meta name=\"topicid\" content=\"GUID-77346A0E-9639-4066-B3E8-9738FE193E0D\">\n      <meta name=\"topic-type\" content=\"concept\">\n      <title>To Include Extra Software in a Deployment</title><script language=\"javascript\">var index = \'index.html\';</script></head>\n   <body height=\"100%\">\n      <div class=\"body_content\" id=\"body-content\" dir=\"ltr\"><a name=\"GUID-77346A0E-9639-4066-B3E8-9738FE193E0D\"></a><div class=\"head\">\n            <h1>To Include Extra Software in a Deployment</h1>\n         </div>\n         <p class=\"blurb\">  </p>\n         <p><a name=\"GUID-D222ABAA-AB79-4D51-940D-75247A4D6273\"></a> When you create a deployment, the installer may give you the option to include extra\n            software in your image. This extra software appears at the end of the product list\n            in the installer. \n            	 \n         </p>\n         <p><a name=\"GUID-E65E0127-9470-4376-B5DD-5D8BE49E4F6E\"></a>This software usually consists of components from Autodesk or other third-party software\n            vendors. Some products can install language packs this way. The extra software must\n            be packaged in a self-extracting EXE (executable) or MSI format. \n            	 \n         </p><a name=\"GUID-330DD121-5E31-49C2-BB9F-C255505BE07C\"></a><ol start=\"1\">\n            <li>Before creating a deployment, store the EXE and MSI software packages in a single\n               location that is easy to find. \n               		\n            </li>\n            <li>When you create a deployment, at the end of the product list in the installer, click\n               the option to include more software. \n               		  \n               <p><a name=\"GUID-0859762F-F316-45F0-9FD0-54D4BC9139C3\"></a>You see a table in which to manage the software. \n                  		  \n               </p> \n            </li>\n            <li>Above the table, click Add, browse to the file location, and then click a file. \n               		  \n               <p><a name=\"GUID-FB5947A0-E943-4D25-97EA-14F4E8C3C35D\"></a>The filename and path are added to the management table. Repeat this step to add more\n                  files. \n                  		  \n               </p> \n            </li>\n            <li>After you add all the files, click inside the Include Additional Software box to hide\n               the table. \n               		\n            </li>\n         </ol>\n         <div class=\"footer-block\"><a href=\"..\" class=\"comments-anchor\" target=\"_blank\"><span class=\"comments-link\">Please send us your comment about this page</span></a></div><br><p class=\"footer-license-block\"><a rel=\"license\" href=\"http://creativecommons.org/licenses/by-nc-sa/3.0/\" target=\"_blank\"><img alt=\"Creative Commons License\" style=\"border-width: 0;\" src=\"../images/ccLink.png\"></a>&nbsp;<em>Except where otherwise noted, this work is licensed under a <a rel=\"license\" href=\"http://creativecommons.org/licenses/by-nc-sa/3.0/\" target=\"_blank\">Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License</a>. Please see the <a href=\"http://autodesk.com/creativecommons\" target=\"_blank\">Autodesk Creative Commons FAQ</a> for more information.</em></p><br></div>\n   </body>\n</html>";
